    [],nt"revision_timestamp": "2016-07-27T22:55:30.856327",nt"name": "lake-ilo-national-wildlife-refuge-annual-narrative-report-calendar-year-1987",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Lake Ilo
    National Wildlife Refuge outlines Refuge accomplishments during the 1987 calendar
    year. The report begins with a summary of the year's highlights and weather conditions.
    Land acquisition is discussed. Refuge administration is outlined; information about
    personnel, volunteer programs, funding, and safety is given. Habitat management
    is also covered; subjects include wetlands, forests, croplands, grasslands, fire
    management, pest control, and water rights. The wildlife section of the report discusses
    endangered and threatened species, migratory birds, raptors, game mammals, fisheries
    resources, and animal control. The public uses of the Refuge described in this report
    include recreational uses and law enforcement. The equipment and facilities section
    of the report provides information about new construction, rehabilitation, major
    maintenance, equipment replacement, and communication systems. Cooperative programs
    are provided at the end. Photographs are attached. Brief narratives on White Lake,
    Stewart Lake, and Pretty Rock National Wildlife Refuges are included.",nt"license_title":
